@pityfi @CdNLeon A verdade é que eles não querem saber quem matou a Marielle, eles querem escolher quem foi.
- Se fica calado é porque consentiu;
- Se procura e consegue se defender: Ain, ele acessou os arquivos do condomínio...

Não conseguem perceber a própria sujeira.

@JorgedeArlanza @rpr3z Se olvida de la etapa Navarro. Iceta a su lado es Bismarck.
E insisto, Cs ha dado por supuesto que le iban a seguir en su carrera suicida.
Nada que no le hayan advertido mil veces. No puede haber sorpresa ahora.
